import React from 'react';
import logo from './logo.svg';
import './styles/tailwind.css';

class App extends React.Component {	
    constructor(props) {
        super(props);
        this.state={
          loaded:false,
        }
      }
    goTo(event) {
        const value = event.target.value;
        this.props.history.push(`/${value}`);
      }
    componentDidMount(){
      fetch("http://localhost:3001/db")
          .then(function (response) {
            console.log("hi");
              return response.json();
          })
          .then(function (data) {
              if (data["error"]) {
                  this.setState({
                      error: data["message"]
                  });
                  console.log(data);
              }
              else {
                  console.log(data);
                  this.setState({message:data['data'][0]});
                  this.setState({loaded:true});
                  console.log(this.state);
              }

          }.bind(this))
    }

	render() {
    	return (
        this.state.loaded &&
        <div className="App flex justify-center items-center align-center h-screen items-center " >
<div class="w-full max-w-screen-xl mx-auto p-6">
  <div class="relative rounded overflow-hidden  mb-8 bg-white">
    <div class="p-4  py-8">
      <div class="mx-auto max-w-sm shadow-lg rounded-lg overflow-hidden">
        <div class="sm:flex sm:items-center px-2 py-4">
          <div class="flex-grow">
            <h3 class="font-normal px-2 py-3 leading-tight">Users</h3>
            <div class="w-full">
            <div class="flex cursor-pointer my-1 hover:bg-blue-lightest rounded">
                <div class="w-8 h-10 text-center py-1">
                  <p class="text-3xl p-0 text-green-dark">&bull;</p>
                </div>
                <div class="w-4/5 h-10 py-3 px-1">
                  <p class="hover:text-blue-dark">{this.state.message.name}</p>
                </div>
                <div class="w-1/5 h-10 text-right p-3">
                  <p class="text-sm text-grey-dark">{this.state.message.comments}</p>
                </div>
              </div>
            </div>
          </div>
        </div>

      </div>
    </div>
  </div>
</div>
  </div>
		)	
	}
}

export default App;
